import React from 'react'

export default function HeaderLogin(props:{
    nickName:string,
}) {
  return (
    <>
    <div className='flex'>
        <div className='bg-avatar w-[50px] h-[50px] bg-cover rounded-3xl'></div>
        <p>{props.nickName}</p>
    </div>
    </>
  )
}
